  return (
    <div>
      <Banner></Banner>
      <Tableau></Tableau>

      <Router>
      <div>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/liste" element={<Liste />} />
          <Route path="/add" element={<Add />} />
        </Routes>
      </div>
    </Router>

    </div>

  );

}

const Home = () => {
  return <h2>Home</h2>;
};

const Liste = () => {
  return <h2>Liste</h2>;
};

const Add = () => {
